import classNames from "classnames";
import React from "react";
import "../index.css";
import classnames from "classnames";
export default function Notes({ header, text, count }) {
  console.log(header);
  return (
    <div>
      {header.map((val, index) => (
        <p
          key={index}
          className={classnames("note", {
            red: count >= 8,
          })}
        >
          {count >= 8 && <br>"У вас слишком много заметок"</br>}
          {"Header:" + val}
          <br></br>
          {text[index]}
        </p>
      ))}
    </div>
  );
}
